import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import nature from './ressources/nature.jpg';

function Product(){
    return(

        <div class="card">
            <div class="card-header d-block">
            <div id="element1">
    element 1 markup
</div>
<div id="element2">
    element 2 markup
</div>
                
            </div>
            <img src={iphone} class="card-img-top" alt="alt-image-cap" id="product-photo"/>
            <div class="card-body">
                <h6 class="card-text ">Pent brukt Iphone X</h6>
                <button class="btn btn-primary">Send Message</button>
            </div>
        </div>

    
    );
}

export default Product;
